import api from './api';

export const usersService = {
  async getProfile() {
    const { data } = await api.get('/users/profile');
    return data;
  },

  async updateProfile(profile) {
    const { data } = await api.put('/users/profile', profile);
    return data;
  }
};

export default usersService;
